import React from 'react';
import { useNavigate } from 'react-router-dom';
import { useState, useEffect, useRef } from 'react';
import axios from 'axios';


function Signup() {
  const [username, setUsername] = useState('');
  const [email, setEmail] = useState('');
  const [password, setPassword] = useState('');
  const [password2, setPassword2] = useState('');
  const [name, setName] = useState('');
  const [gender, setGender] = useState('')
  const [age, setAge] = useState('');
  const [place, setPlace] = useState('');
  const [prefix, setPrefix] = useState('')
  const [phone, setPhone] = useState('')

  const [userDetails, setUserDetails] = useState(null);

  let navigate = useNavigate();

  useEffect(() => {
    setUserDetails({ username, email, password, password2, name, gender, age, place, prefix, phone });
  }, [username, email, password, password2, name, gender, age, place, prefix, phone]);

  const handleUsernameChange = (event) => {
    setUsername(event.target.value);
  }
  
  const handleEmailChange = (event) => {
    setEmail(event.target.value);
  }
  
  const handlePasswordChange = (event) => {
    setPassword(event.target.value);
  }
  
  const handlePassword2Change = (event) => {
    setPassword2(event.target.value);
  }
  
  const handleNameChange = (event) => {
    setName(event.target.value);
  }
  
  const handleGenderChange = (event) => {
    setGender(event.target.value);
  }

  const handleAgeChange = (event) => {
    setAge(event.target.value);
  }

  const handlePlaceChange = (event) => {
    setPlace(event.target.value);
  }

  const handlePrefixChange = (event) => {
    setPrefix(event.target.value);
  }

  const handlePhoneChange = (event) => {
    setPhone(event.target.value);
  }

  const handleSubmit = (event) => {
    event.preventDefault();
    axios.post('/api/user', userDetails)
      .then(response => {
        console.log(response.data);
      })
      .catch(error => {
        console.error(error);
      });
  }


    return (
    <div>
      <form onSubmit={handleSubmit}>
        <label>
          User name:
          <input type="text" value={username} onChange={handleUsernameChange} />
        </label>
        <br />
        <label>
          Email:
          <input type="email" value={email} onChange={handleEmailChange} />
        </label>
        <br />
        <label>
          Phone:
          <input type="text" value={password} onChange={handlePasswordChange} />
        </label>
        <br />
        <label>
          Name:
          <input type="text" value={password2} onChange={handlePassword2Change} />
        </label>
        <br />
        <label>
          Email:
          <input type="text" value={name} onChange={handleNameChange} />
        </label>
        <br />
        <label>
          Phone:
          <input type="text" value={gender} onChange={handleGenderChange} />
        </label>
        <br />
        <label>
          Name:
          <input type="text" value={age} onChange={handleAgeChange} />
        </label>
        <br />
        <label>
          Email:
          <input type="text" value={place} onChange={handlePlaceChange} />
        </label>
        <br />
        <label>
          Phone:
          <input type="tel" value={prefix} onChange={handlePrefixChange} />
        </label>
        <br />
        <label>
          Phone:
          <input type="tel" value={phone} onChange={handlePhoneChange} />
        </label>
        <br />
        
        <button type="submit">Submit</button>
      </form>
      <button onClick={()=>navigate("/")}>Back Home</button>
    </div>
  );
}

export default Signup;
